import React from 'react';

import Card from '../Card/Card';
import classes from './Feira.module.css';

const feira = ( props ) => {
    const footer = dateFormat(props.data, "dddd, mmmm dS, yyyy, h:MM:ss TT");

    return (
        <Card 
            nome={props.nome} 
            descr={props.descr}
            footer={props.data}
            img={footer}
        />
    );
};

export default feira;
